import { Row } from "antd";
import styled from 'styled-components'

export const WrapperHeader = styled(Row)`
   padding: 10px 120px;
   background: #ccc
`
export const Header = styled.div`
   font-family: 'Poppins' sans-serif
`

export const LogoText = styled.span`
   font-weight: bold;
   font-size: 1rem ;
   color: white;
   text-align: center
`
